function Hashtable(){this.items={}}Hashtable.newFrom=function(t){var e=new Hashtable;return e.items=t,e},Hashtable.prototype.put=function(t,e){this.items[t]=e},Hashtable.prototype.get=function(t){return this.items[t]},Hashtable.prototype.containsKey=function(t){return this.items.hasOwnProperty(t)},Hashtable.prototype.remove=function(t){delete this.items[t]},Hashtable.prototype.firstKey=function(){for(var t in this.items)if(this.items.hasOwnProperty(t))return t;return null},Hashtable.prototype.keys=function(t){t.length=0;for(var e in this.items)this.items.hasOwnProperty(e)&&t.push(e)},Hashtable.prototype.values=function(t){t.length=0;for(var e in this.items)this.items.hasOwnProperty(e)&&t.push(this.items[e])},Hashtable.prototype.clear=function(){for(var t in this.items)this.items.hasOwnProperty(t)&&delete this.items[t]};